import { Link } from "react-router-dom"

const AllPuppies = (props) => {
    console.log(props)
    return (
        <div>
            <h2> All Puppy Players: </h2>

            {
            props.puppyProps.length ? props.puppyProps.map((singlePuppyElement, idx) => {
                return (

                    <div key={idx}>
                        <p>Name: {singlePuppyElement.name}
                        </p>
                    </div> 
                )
            }) : <div> No data yet...</div>
            } 
        </div>
    )
}

export default AllPuppies;
